sources.css/style.scss:
section {
    position: relative;
}

@mixin rellax($width, $top, $left) {
    width: $width;
    top: $top;
    left: $left;
}

@mixin relWord($top, $left, $fontSize) {
    top: $top;
    left: $left;
    font-size: $fontSize;
}

@import "./_travel";
@import "./_collage";
@import "./_zoom";
@import "./_misc";
@import "./_homeButton";


* {
    margin: 0px;
    padding: 0px;
    box-sizing: border-box;
}

body {
    color: #000000;
    height: 0px;   
     transition: background-color 0.3s ease-in-out;
}


.movArt,
.movMusic,
.movTravel,
.movMisc {
    position: absolute;
    overflow: hidden;
    width: 150px;
    height: 150px;
    font-size: 48px;
    line-height: 1.5;
}

.movArt {
    top: 40px;
    left: 50%;
    transform: translate(-50%, 0);
}

.movMisc {
    bottom: 40px;
    left: 50%;
    transform: rotate(180deg) translate(50%, 0);
}

.movTravel {
    top: 50%;
    right: 40px;
    transform-origin: 100% 0;
    transform: rotate(90deg) translate(50%, 0);
}

.movMusic {
    top: 50%;
    left: 40px;
    transform-origin: 0 0;
    transform: rotate(-90deg) translate(-50%, 0);
}

.movers,
.movers2,
.movers3,
.movers4 {
    white-space: nowrap;
}

a {
    color: #2727e6;
    text-decoration: none;
}

.home {
    position: fixed;
    top: 50%;
    left: 50%;
    transform: translate(-50%, -50%);
}

.home {
    width: 50%;
    opacity: 0;
    transition: opacity 0.3s ease-in-out;
    border: 5px solid yellowgreen;
}


h1 {
    color: #2727e6;
    margin: 0;
    font-size: 1em;
    transition: opacity 0.2s ease-in-out;
}

.home-content {
    top: 0%;
    background-color: cornsilk;
    width: 100%;
    height: 100%;
    overflow: hidden;
    position: fixed;
}



a {
    &.music,
    &.travel,
    &.misc,
    &.art {
        position: fixed;
    }
}

/* remove zoom on double tap */ 
* {
  touch-action: manipulation;
}

@import "./_mediaQueries";

